<script>
import Datepicker from 'vue3-datepicker';
export default {
    name: "goalCard",
    props: {
        savingGoal: {
            type: Array,
            required: true,
        },
    },
    components: {
        Datepicker
    },
    methods: {
        numberWithCommas(x) {
            // phase x to number
            x = Number(x);
            if(x % 1 === 0)
                return x.toLocaleString(undefined, {
                    minimumFractionDigits: 0,
                    maximumFractionDigits: 0
                })
            else
            return x.toLocaleString(undefined, {
                minimumFractionDigits: 2,
                maximumFractionDigits: 2
            })
        },
        onClickCard(goal) {
            this.selectedGoal = { ...goal }
            this.selectedGoal.date = new Date(this.selectedGoal.date);
            this.showdialog = true;
        },
        onSaveGoal() {
            let index = this.savingGoal.findIndex(goal => goal.id === this.selectedGoal.id);
            this.savingGoal[index] = { ...this.selectedGoal };
            this.editMode = false;
            this.showdialog = false;
        },
        onCancelGoal() {
            this.editMode = false;
            this.showdialog = false;
        },
        onDeleteGoal() {
            let index = this.savingGoal.findIndex(goal => goal.id === this.selectedGoal.id);
            this.savingGoal.splice(index, 1);
            this.editMode = false;
            this.showdialog = false;
        },
    },
    data() {
        return {
            showdialog: false,
            editMode: false,
            selectedGoal: {},
            images: [
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,",
        "data:image/png;base64,"
      ],
        };
    },
    computed:{
        goals(){
            return this.savingGoal.sort((a, b) => {
                if (b.amount - b.saving <= 0 && a.amount - a.saving > 0) return -1;
                else return 1;
            });

        }
    }
};
</script>

<template>

    <v-card
        style="margin:20px 100px; padding:10px 10px;border:1px solid black; display:flex; justify-content: begin; align-items:center;"
        outlined max-width="1200px" @click="onClickCard(goal)" v-for="goal in goals" :key="goal.id"
        :disabled="goal.amount - goal.saving <=0">
        <div>
            <v-img
                :src="images[goal.image]"
                :aspect-ratio="1 / 1" :width="150"></v-img>
        </div>
        <div style="width:100%">
            <v-card-title class="text-h4">{{ goal.name }}</v-card-title>
            <v-card-subtitle class="text-h6" style="padding-top:1rem">
                 {{ new Date(goal.date).toLocaleString('th-TH', {
                        year: 'numeric', month: 'short', day: 'numeric'
                    })
                }}
                 {{ Math.floor((new Date(goal.date) - new Date()) / (1000 * 3600 * 24)) + 1  }} .
            </v-card-subtitle>
            <div style="display:flex; justify-content:space-between; padding:1rem; padding-bottom: 0;">
                <span class="text-h6 "> 
                    <span
                        :style="[goal.amount - goal.saving > 0 ? { 'color': 'blue', 'font-weight': 'bold' } : { 'color': 'black', 'font-weight': 'normal' }]">{{
                                numberWithCommas(goal.saving)
                        }}</span> . 
                    <span
                        :style="[goal.amount - goal.saving > 0 ? { 'color': 'blue', 'font-weight': 'bold' } : { 'color': 'black', 'font-weight': 'normal' }]">{{
                                numberWithCommas(goal.amount)
                        }}</span> 
                </span>
                <span class="text-h6 " v-if="goal.amount - goal.saving > 0"> 
                    <span style="color:blue; font-weight: bold;">{{ numberWithCommas(goal.amount - goal.saving) }}
                    </span> 
                </span>
                <span v-else>  </span>
            </div>
        </div>
    </v-card>

<v-dialog v-model="showdialog" max-width="500px">
        <v-card>
            <v-card-title>
                <span class="headline ma-6">Editing goal</span>
            </v-card-title>
            <div style="padding:24px 40px;">

                <label><center></center></label>
                <div style="display:flex; align-items:center;">
                  <v-btn @click="selectedGoal.image = (selectedGoal.image + 1) % images.length" :disabled="!editMode"><v-icon dark right>
                      mdi-arrow-left-drop-circle </v-icon> </v-btn>
                  <v-img :src="images[selectedGoal.image]" height="200px"></v-img>
                  <v-btn :disabled="!editMode"
                    @click="selectedGoal.image  = (selectedGoal.image  > 0) ? selectedGoal.image  - 1 : images.length - 1"><v-icon
                      dark right>
                      mdi-arrow-right-drop-circle </v-icon>
                  </v-btn>
                </div>
              </div>
              <v-card-text>
                <v-container>
                  <v-row>
                    <v-col cols="12 py-0">
                      <label>Title</label>
                      <v-text-field id="name" required variant="outlined" v-model="selectedGoal.name" placeholder="" :disabled="!editMode"></v-text-field>
                    </v-col>
      
                    <v-col cols="12 py-0">
                      <label>Amount</label>
                      <v-text-field id="amount" required variant="outlined" :disabled="!editMode"
                      v-model="selectedGoal.amount" type="number" placeholder="25000"></v-text-field>
                  </v-col>
                  
                  <v-col cols="12 py-0">
                      <label for="date" class="label">Date end</label>
                      <Datepicker v-model="selectedGoal.date" class="text-field" label="Date" variant="outlined" :disabled="!editMode" 
                      :style="[editMode? {'color':'black'}: {'color':'#888888', 'border-color':'#dddddd'}]"
                      placeholder="YYYY-MM-DD" />
                    </v-col>
                    <v-col cols="12 ">
                      <v-textarea clearable label="discription" variant="outlined" v-model="selectedGoal.description" :disabled="!editMode" ></v-textarea>
                    </v-col>
                  </v-row>
                </v-container>
              </v-card-text>

            <v-card-actions v-if="editMode">
                <v-spacer></v-spacer>
                <v-btn color="red darken-1" text @click="onDeleteGoal">DELETE</v-btn>
                <v-btn color="blue darken-1" text @click="onCancelGoal">CANCLE</v-btn>
                <v-btn color="blue darken-1" text @click="onSaveGoal">SAVE</v-btn>
            </v-card-actions>

            <v-card-actions v-else>
                <v-spacer></v-spacer>
                <v-btn color="blue darken-1" text @click="editMode = true">EDIT</v-btn>
                <v-btn color="blue darken-1" text @click="showdialog = false">CLOSE</v-btn>
            </v-card-actions>
        </v-card>
    </v-dialog>


</template>

